import React from 'react';
import './css/Sidebar.css'

const Sidebar = ({ onLogout }) => {
  const handleLogout = () => {
    // Implement logout logic
    onLogout();
  };

  return (
    <div style={{ width: '250px', minHeight: '100vh', background: '#f0f0f0', padding: '20px' }}>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        <li> style={{ margintop: '50px' }}<a href="#home">Home</a></li>
        <li><a href="#jobs">Jobs</a></li>
        <li><a href="#companies">Companies</a></li>
        <li><a href="#skills">Skills</a></li>
        <li><a href="#sort-jobs">Sort Jobs</a></li>
        <li><a href="#user-settings">User Settings</a></li>
        <li style={{ color: 'red', cursor: 'pointer' }} onClick={handleLogout}>Log Out</li>
      </ul>
    </div>
  );
};

export default Sidebar;
